    'help.WhatShouldIDoIfISuspectAFraudulentBuyer': '\u0427\u0442\u043E \u0434\u0435\u043B\u0430\u0442\u044C, \u0435\u0441\u043B\u0438 \u044F \u043F\u043E\u0434\u043E\u0437\u0440\u0435\u0432\u0430\u044E \u043F\u043E\u043A\u0443\u043F\u0430\u0442\u0435\u043B\u044F-\u043C\u043E\u0448\u0435\u043D\u043D\u0438\u043A\u0430?',
